import React from 'react';

const SlotM = () => {
  let x = '游때';
  let y = '游때';
  let z = '游때';

  if ((x===y) && (y===z)) {
     return (
       <>
       <div className="slot_inner">
         <h1>
         {x} {y} {z}
         </h1>
         <h1> This is Matching </h1>
         <hr />
       </div>
       </>
          )
  }
  else {
    return (
      <>
      <div className="slot_inner">
        <h1>
        {x} {y} {z}
        </h1>
        <h1> This is Not Matching </h1>
        <hr />
      </div>
      </>
         )
  }
}


const App = () =>{
return (
  <>
  <h1 className="heading_style"> 
  游꿣  Welcome to <span style = {{ fontWeight: "bold" }}> Slot machine game </span> 游꿣 
  </h1>
  <SlotM />
  </>
)
}

export default App;
